import React, { Component } from "react";
import { Route, Link } from "react-router-dom";
import "./pokemonlist.css"
import PokemonDetail from "../PokemonDetail/PokemonDetail";

export default class PokemonList extends Component {
    render() {
        return (
            <section className="pokeGridContainer">
                {this.props.pokemonList.map(({ name, id }) => (
                    // <Link key={name} to={`/detail/${name}`}>
                    <Link key={id} to={`/detail/${id}`}>
                        <div className="pokeGridItemContainer" key={id}>
                            <img className="pokemonImg"
                                src={`https://pokeres.bastionbot.org/images/pokemon/${id}.png`}
                                alt="pokemon"
                            />
                            <span className="pokeName">
                {name} #{id}
              </span>
                        </div>
                    </Link>
                ))}
                <Route exact path="detail/:id" component={PokemonDetail} />
            </section>
        );
    }
}
